import pygame
import tkinter as tk
from pygame import mixer
import base64
import io
import threading

# MP3-Daten als Base64-Strings (Beispieldaten - ersetze mit deinen eigenen)
# Um deine MP3 einzubinden: 
# 1. Ã–ffne die MP3 in einem Hex-Editor oder konvertiere sie mit:
#    with open("datei.mp3", "rb") as f:
#        print(base64.b64encode(f.read()).decode('utf-8'))
# 2. Kopiere den generierten String hier ein

FIRST_MP3_BASE64 = ""  # Hier ersten MP3 Base64-String einfÃ¼gen
LOOP_MP3_BASE64 = ""   # Hier zweiten MP3 Base64-String einfÃ¼gen

class BlackScreenPlayer:
    def __init__(self):
        # Audio initialisieren
        pygame.init()
        mixer.init()
        
        # Hauptfenster erstellen
        self.root = tk.Tk()
        self.root.attributes('-fullscreen', True)
        self.root.configure(bg='black')
        self.root.overrideredirect(True)  # Keine Titelleiste
        
        # Tastenkombinationen blockieren
        self.root.bind("<Alt-F4>", lambda e: "break")
        self.root.bind("<Control-q>", lambda e: "break")
        self.root.bind("<Control-w>", lambda e: "break")
        self.root.bind("<Escape>", lambda e: "break")
        
        # MP3-Daten dekodieren
        self.first_mp3 = base64.b64decode(FIRST_MP3_BASE64)
        self.loop_mp3 = base64.b64decode(LOOP_MP3_BASE64)
        
        # Audio in Thread abspielen
        self.audio_thread = threading.Thread(target=self.play_audio, daemon=True)
        self.audio_thread.start()
    
    def play_audio(self):
        try:
            # Erste MP3 abspielen
            if self.first_mp3:
                mixer.music.load(io.BytesIO(self.first_mp3))
                mixer.music.play()
                
                # Warten bis fertig
                while mixer.music.get_busy():
                    pygame.time.Clock().tick(10)
                    self.root.update()
            
            # Loop MP3 abspielen
            if self.loop_mp3:
                mixer.music.load(io.BytesIO(self.loop_mp3))
                mixer.music.play(-1)  # Endlosschleife
                
        except Exception as e:
            print(f"Audiofehler: {e}")
            self.root.destroy()
    
    def run(self):
        try:
            self.root.mainloop()
        except KeyboardInterrupt:
            self.root.destroy()

if __name__ == "__main__":
    if not FIRST_MP3_BASE64 or not LOOP_MP3_BASE64:
        print("Fehler: MP3-Daten mÃ¼ssen als Base64-Strings eingefÃ¼gt werden!")
    else:
        player = BlackScreenPlayer()
        player.run()